import React, { Component } from "react";
import { Link } from "react-router-dom";
import PropTypes from "prop-types";
import { connect } from "react-redux";

class Orderitem extends Component {
  render() {
    const { orders } = this.props;
    return (
      <tr className="even pointer">
        <td className="a-center ">{orders.cmdDate}</td>
        <td className="a-center ">{orders.cmdNum}</td>
        <td className="a-center ">{orders.total}</td>
        <td className="a-center ">{orders.client}</td>
        <td className="a-center ">{orders.bill}</td>
        <td className="a-center ">{orders.products}</td>
      </tr>
    );
  }
}

export default connect(null, {})(Orderitem);
